import React, { Component } from "react";
import "../../style.css"

class PostContainer extends Component {
  constructor() {
    super();
    this.state = {
      name: "Profile"
    };
  }

  render() {
    return (
        <div className="newPost"></div>
    )

  }
}

export default PostContainer;
